import React from "react";
import axios from "axios";
import styled from "styled-components/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { NavigationContainer } from "@react-navigation/native";
import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View } from "react-native";
import { Home, ChatList, Chat } from "./components";
import { Con, HeaderLogo } from "./assets/common/common";
import Icon from "react-native-vector-icons/MaterialCommunityIcons";

export default function App() {
  const Tab = createBottomTabNavigator();

  const TabIcon = (name, size, color) => {
    return <Icon name="home" size={size} color={color} />;
  };

  return (
    <NavigationContainer>
      <Tab.Navigator
        initialRouteName="Home"
        screenOptions={{
          headerLeft: () => {
            return (
              <HeaderLogo onPress={() => console.log()}>동네사진관</HeaderLogo>
            );
          },
          headerTitle: "",
          tabBarShowLabel: false,
          tabBarInactiveTintColor: "#e0e0e0",
          tabBarActiveTintColor: "#c5e1a5",
        }}
        options={{
          tabBarVisible: false,
        }}
      >
        <Tab.Screen
          name="Home"
          component={Home}
          options={{
            tabBarVisible: true,
            // tabBarIcon: (props) => {
            //   return (
            //     <Icon
            //       name="home-variant-outline"
            //       size={35}
            //       color={props.color}
            //     />
            //   );
            // },
          }}
        />
        <Tab.Screen
          name="Chat"
          component={Chat}
          options={{
            tabBarIcon: (props) => {
              return <Icon name="chat-outline" size={35} color={props.color} />;
            },
          }}
        />
        <Tab.Screen
          name="ChatList"
          component={ChatList}
          options={{
            tabBarIcon: (props) => {
              return (
                <Icon name="account-outline" size={35} color={props.color} />
              );
            },
          }}
        />
      </Tab.Navigator>
    </NavigationContainer>
  );
}
